//import logo from './logo.svg';
import NavBar from "./components/navbar";
import Counters from "./components/counters";
import "./App.css";

class App extends Component {
  render() {
    return (
      <React.Fragment>
        <main className="container">
          <Counters />
        </main>
      </React.Fragment>
    );
  }
}

export default App;
